import React from 'react';
import logo from '../Logo/tb.png';
import { Navbar, Text } from "@nextui-org/react";

function MyNavbar() {
  return (
    <div>
      <Navbar isBordered variant={'floating'}>
        <Navbar.Brand>
          <Text b color={'inherit'} hideIn={'xs'}>
            Brand
          </Text>
          Hello
        </Navbar.Brand>
        <Navbar.Content>
          hi
        </Navbar.Content>
      </Navbar>
    </div>
  );
}

export default MyNavbar;
